import { Box, Button, TextField, Typography } from "@mui/material";
import MyButton from "./MyButton";

const OrderListFirst = ({ setPageNumber }) => {
  return (
    <Box>
      <Box display="flex" alignItems="center">
        <Typography mx={2}>출발지</Typography>
        <TextField margin="normal" id="origin" name="origin" autoFocus />
      </Box>
      <Box display="flex" alignItems="center">
        <Typography mx={2}>도착지</Typography>
        <TextField
          margin="normal"
          id="destination"
          name="destination"
          autoFocus
        />
      </Box>
      <Box display="flex" alignItems="center" justifyContent="center">
        <Box m={2}>
          <MyButton
            type="negative"
            value="뒤로가기"
            onClick={() => {
              setPageNumber(1);
            }}
          />
        </Box>
        <Box m={2}>
          <MyButton
            value="다음"
            onClick={() => {
              setPageNumber(2);
            }}
            mx={2}
          />
        </Box>
      </Box>
    </Box>
  );
};

export default OrderListFirst;
